import React from 'react';
import styled from "styled-components";
import Logo from "../header/images/logo.png"
import Profile from "../header/images/profile.png"
import Inventory from "../header/images/inventory.png"
import Notifications from "../header/images/notifications.png"
import Tracker from "../header/images/tracker.png"
import Text from "../../theme/text";
import Image from "../../theme/image";

const HeaderWrapper = styled.div`
  background-color: #320F0F;
  padding: 5px 15px;
  display: flex;
  flex-direction: row;
  justify-content: space-between; 
  align-items: center;
`;

const RowContainer = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
`;

function Header() {
    return (
        <HeaderWrapper>
            <Image src={Logo}/>
            <RowContainer style={{columnGap: "30px"}}>
                <RowContainer>
                    <Image margin={"0 10px 0 0"} src={Tracker}/>
                    <Text fontWeight={800}>
                        Investment<br/>tracker
                    </Text>
                </RowContainer>
                <RowContainer>
                    <Image margin={"0 8px 0 0"} src={Inventory}/>
                    <Text fontWeight={800}>
                        Inventory
                    </Text>
                </RowContainer>
            </RowContainer>
            <RowContainer style={{columnGap: "30px"}}>
                <RowContainer>
                    <Image margin={"0 10px 0 0"} src={Notifications}/>
                    <Text fontWeight={800}>
                        Notifications
                    </Text>
                </RowContainer>
                <RowContainer>
                    <Image margin={"0 5px 0 0"} src={Profile}/>
                    <Text fontWeight={800}>
                        Hello, uz1mane!
                    </Text>
                </RowContainer>
            </RowContainer>
        </HeaderWrapper>
    );
}

export default Header;
